        <img src="" alt="" />
      </div>
      <div className="product-item-name">sss</div>
      <div className="product-item-description">sss</div>
      <div className="product-item-name">sss</div>
      <div className="product-item-info">
        <div className="product-price">10</div>
        <div className="product-checked">
          <img src="" alt="" />
        </div>
      </div>
    </div>;
  });
  return { cardList };
};

export default ProductItem;
